import axios from 'axios';

const AllProjects = (username, password) => {
    console.log(username)
    axios.post('/projects', {
        username,
        password
    })
    .then(function (response) {
        console.log(response);
    })
    .catch(function (error) {
        console.log(error);
    });
}

export default AllProjects
